import React, {Component} from 'react';
import {BrowserRouter} from 'react-router-dom';
import Navbar from './components/Layout/Navbar';
import Signin from './components/auth/Signin'

class App extends Component {
	render() {
 		return (
  			<BrowserRouter>
    			<div className="App">
    				<Navbar />
    				<Signin />
    			</div>
    		</BrowserRouter>

  		);
	}
}

export default App;
